pragma solidity ^0.4.24;

import "../tokens/ERC20Token/IERC20Token.sol";
contract MixinERC20 {
    string constant ERROR_TRANSFER_FAILED = "TRANSFER_FAILED";

    function transferToken(
        address token,
        address account,
        uint amount)
        internal
    {
        require(IERC20Token(token).transfer(account, amount), ERROR_TRANSFER_FAILED);
    }
}

sourceCodes.current/forwarder/MixinERC721.sol:
pragma solidity ^0.4.24;

import "zeppelin-solidity/contracts/token/ERC721/ERC721Basic.sol";

contract MixinERC721 {
    // Equals to `bytes4(keccak256("onERC721Received(address,uint256,bytes)"))`
    bytes4 constant ERC721_RECEIVED = 0xf0b9e5ba;

    function onERC721Received(address, uint256, bytes memory)
        public
        pure
        returns(bytes4)
    {
        return ERC721_RECEIVED;
    }

    function transferNFTToken(
        address token,
        address to,
        uint256 tokenId)
        internal
    {
        ERC721Basic(token).transferFrom(address(this), to, tokenId);
    }
}

